def apply(self, other):
    if isinstance(other, datetime):
        fixed_other = datetime(
            other.year,
            other.month,
            other.day,
            other.hour,
            other.minute,
            other.second,
            other.microsecond
        )
        n = self.n

        businesshours = sum(
            (en - st).seconds
            for st, en in zip(self.start, self.end)
        )

        # handle adjustment of business days
        if n != 0:
            bd, r = divmod(abs(n * 60), businesshours // 60)
            if n < 0:
                bd, r = -bd, -r
            adjusted = fixed_other + timedelta(days=bd)

            # handle adjustment of business hours
            adjusted += timedelta(minutes=r)
        else:
            adjusted = fixed_other

        return adjusted
    else:
        raise ApplyTypeError("Only know how to combine business hour with datetime")
